import { useState, useEffect } from "react";
import "./affordableLogo.css";

function AffordableLogo() {
  const [marginAnimate, setMargineAnimate] = useState(21);

  useEffect(() => {
    setMargineAnimate(16);
  });

  return (
    <div>
      <div className="affordableLogo" style={{ margin: marginAnimate }} />
      <div className="affordableLogo" />
      <div className="affordableLogo" />
      <div className="affordableLogo" />
    </div>
  );
}

export default AffordableLogo;
